import React, { Component } from "react";

class Signup extends Component {
  render() {
    return (
      <div>
        <h2>NO NEED TO SIGN UP.</h2>
        <img src="images/CircleTexture2.png" alt="Smiley face" height="42" width="42"/>
        <img src="images/CircleTexture2.png" alt="Circle"/>
        <img src="images/CircleTexture2.png" className="box"/>
        <img src="images/CircleTexture2.png" className="box"/>
      </div>
    );
  }
}

export default Signup;
